import "./App.css";
import "./ant-design.css";
import { LoginOutlined, HomeOutlined } from "@ant-design/icons";
import { Breadcrumb, Layout, Menu, theme, Header, Footer } from "antd";
import LoginPage from "./LoginPage";
import RegisterPage from "./RegisterPage";
function getItem(label, key, icon, children) {
  return {
    key,
    icon,
    children,
    label,
  };
}
const items = [
  getItem("Register", "1", <LoginOutlined />),
  getItem("Login", "2", <LoginOutlined />),
  getItem("Home", "3", <HomeOutlined />),
];
function App() {
  const {
    token: { colorBgContainer },
  } = theme.useToken();

  return (
    <Layout className="layout">
      <Header>
        <Menu theme="dark" mode="horizontal" items={items} />
      </Header>
      <Content
        style={{
          padding: "50px 50px",
        }}
      >
        {/* part for breadcrumbs, look up layout page */}
        <div
          className="site-layout-content"
          style={{
            background: colorBgContainer,
          }}
        >
          {/*content of each page */}
          <div
            className="login-wrap"
            style={{
              display: "flex",
              margin: "10% auto",
              justifyContent: "center",
              width: "200px",
              height: "250px",
            }}
          >
            <LoginPage></LoginPage>
          </div>
        </div>
      </Content>
      <Footer
        style={{
          textAlign: "center",
        }}
      >
        noFil[lter] Â©2023 Created by GOFC
      </Footer>
    </Layout>
  );
}

export default App;
